sys_variable_value.value:
(function execute(inputs, outputs) {
    inputs = new FirstAdvantageSpokeUtils().trimStringInputs(inputs);
    var payload = {};
    var data = [];
    for (var key in inputs) {
        if (inputs[key]) {
            switch (key) {
               //Two step.
                case "two_step":
                    payload[key] = inputs[key] ? "true" : "false";
                    break;
                    //Client References.
                case "client_references":
                    payload[key] = new FirstAdvantageSpokeUtils()
                        .buildArrayPayload(key, inputs[key]);
                    break;
                    //User Defined Fields.
                case "user_defined_fields":
                    payload[key] = new FirstAdvantageSpokeUtils()
                        .buildArrayPayload(key, inputs[key]);
                    break;
                    //Quote Backs.
                case "quote_backs":
                    payload[key] = new FirstAdvantageSpokeUtils()
                        .buildArrayOfObjectsPayload(key, inputs[key]);
                    break;
                    //Order As.
                case "order_as":
                    if ((inputs[key]['account_id_order_as'] && inputs[key][
                            'user_id'
                        ] && inputs[key]['email']) || (!inputs[key][
                            'account_id_order_as'
                        ] && !inputs[key]['user_id'] && !inputs[key][
                            'email'
                        ])) {
                        if (inputs[key]['account_id_order_as'] && inputs[
                                key]['user_id'] && inputs[key]['email']) {
                            payload['additional_attributes'] = {
                                "order_as": {
                                    "account_id": inputs[key][
                                        'account_id_order_as'
                                    ],
                                    "user_id": inputs[key]['user_id'],
                                    "email": inputs[key]['email']
                                }
                            }
                        } else
                            payload['additional_attributes'] = undefined;
                    } else
                        new FirstAdvantageSpokeUtils().validateOrderAs();
                    break;
                case "locale":
                    temp = {};
                    for (keys in inputs[key]) {
                        if (inputs[key][keys] != '')
                            temp[keys] = inputs[key][keys];
                    }

                    if (Object.getOwnPropertyNames(temp).length === 0)
                        payload[key] = undefined;
                    else
                        payload[key] = temp;
                    break;
                    //Position Locations.
                case "position_locations":
                    payload[key] = new FirstAdvantageSpokeUtils()
                        .buildArrayOfObjectsPayload(key, inputs[key]);
                    break;
                    //Add Ons.
                case "add_ons":
                    payload[key] = new FirstAdvantageSpokeUtils()
                        .buildArrayOfObjectsPayload(key, inputs[key]);
                    break;
                default:
                    payload[key] = inputs[key] ? inputs[key] : undefined;
            }
        }
    }
    outputs.payload = JSON.stringify(payload);
})(inputs, outputs);

