sys_variable_value.value:
(function execute(inputs, outputs) {
    inputs = new FirstAdvantageSpokeUtils().trimStringInputs(inputs);
    if (inputs.status_code == '201') {
        outputs.order_id = JSON.parse(inputs.response).order_id;
        outputs.status = "Success";
    } else
        outputs = new FirstAdvantageSpokeErrorHandler()
        .createOrderErrorHandler(inputs, outputs);
})(inputs, outputs);

